(function()
{
	"use strict";

	let bubbler = null;

	document.addEventListener("DOMContentLoaded", start);

	function start()
	{
		bubbler = new ShyLeopard.Bubbler(document.getElementById("target"), 8, 4, 0.5);

		bubbler.onComplete(function()
			{
				console.log("Complete!");
			});

		console.log("ShyLeopard Version: " + ShyLeopard.getVersion());

		generateInitialPicture();

		document.getElementById("uploader").addEventListener("change", uploaderChange);
	}

	function generateInitialPicture()
	{
		let image = new Image();

		image.addEventListener("load", function()
			{
				bubbler.generate(image);
			});

		image.src = "data:image/png;base64,";
	}

	function uploaderChange(event)
	{
		let fileReader = new FileReader();

		fileReader.addEventListener("load", fileReaderLoad);
		fileReader.readAsDataURL(event.target.files[0]);
	}

	function fileReaderLoad(event)
	{
		let image = new Image();

		image.addEventListener("load", function()
			{
				bubbler.generate(image);
				document.getElementById("credits").classList.add("credit-text--hidden");
			});

		image.src = event.target.result;
	}
})();